webpackJsonp([0xd31e64281d75],{5340:function(e,t){e.exports={data:{post:{html:'<p><img src="http://www.papascott.de/wordpress/wp-content/uploads/2001/09/crhsandbottle.jpg" height="244" width="325" border="0" alt="crhsandbottle.jpg: " /></p>\n<p>At age 1-3/4, Christopher is just as old now as I was when JFK was shot.</p>\n<p><img src="http://www.papascott.de/wordpress/wp-content/uploads/2001/09/hhcandles.jpg" height="235" width="345" border="0" alt="hhcandles.jpg: " /></p>\n<p>Candles placed at the US Consulate in Hamburg. <a href="http://spot.eroded.org/thankyou">More pictures</a> from around the world.</p>\n<p>It\'s interesting to compare US and German news coverage. An \'expert\' on CNN said that US intelligence failed because they are underfunded. A German \'expert\' said that US intelligence failed in spite of being  well funded, relying too much on technical rather than human intelligence.</p>',fields:{title:"Sunday at Home",date:"16 Sep 2001",url:"https://papascott.de/2001-09-16-sunday-at-home/"}}},pathContext:{slug:"/2001-09-16-sunday-at-home/",prev:{fields:{title:"Cloudy Skies",date:"15 Sep 2001",slug:"/2001-09-15-cloudy-skies/"}},next:{fields:{title:"World in a Stupor",date:"17 Sep 2001",slug:"/2001-09-17-world-in-a-stupor/"}}}}}});
